import React from "react";
import { Navbar, Button, Link } from "@nextui-org/react";
import { Layout } from "./Navbar/Layout.js";
import { AcmeLogo } from "./Navbar/AcmeLogo.js";
import { useTheme, Text } from '@nextui-org/react';
import { Card, Grid, Row } from "@nextui-org/react";
import createGlobe from "cobe";
import { useEffect, useRef } from "react";
import { Modal, Input, Checkbox} from "@nextui-org/react";
import { Radio } from "@nextui-org/react";
//import paypal requirements for checkout
import { PayPalScriptProvider, PayPalButtons } from "@paypal/react-paypal-js";
//import { loadScript } from "@paypal/paypal-js";
//import { Client } from 'paypal-rest-sdk';
//import { PayPalButton } from "react-paypal-button-v2";


  export default function App() {

  const [variant] = React.useState("sticky");

  const [visible, setVisible] = React.useState(false);
  const handler = () => {
    setVisible(true);
    console.log("opened");
  };
  const closeHandler = () => {
    setVisible(false);
    console.log("closed");
  };


//const client = new Client({
//  clientId: 'AYMGpqJyWXlcyqAQ3_kQUKwO4v18hFXc19g11lI6uk8E9lml2-YXdg5ErLB20PywGkXAIOjTisMXpo6u',
//  secret: 'AYMGpqJyWXlcyqAQ3_kQUKwO4v18hFXc19g11lI6uk8E9lml2-YXdg5ErLB20PywGkXAIOjTisMXpo6u',
//});

//client.setEnvironment('sandbox');
//client.setCurrency('USD');
//client.setMode('sandbox');

//const createOrder = (data, actions) => {
 // return actions.order.create({
  //  purchase_units: [ {
  //    amount: {
//      value: '0.01'
//     }
//    }]
//  });
//};


  const MockItem = ({ text }) => {
    return (
      <Card css={{ h: "$24", $$cardColor: '$colors$primary' }}>
        <Card.Body>
          <Text h6 size={15} color="white" css={{ mt: 0 }}>
            {text}
          </Text>
        </Card.Body>
      </Card>
    );
  };

  return (
    <Layout>
      <Navbar variant={variant} style = {{fontFamily: "Inter"}}>
        <Navbar.Brand>
          <Text b color="inherit" hideIn="xs">
            osiris
          </Text>
        </Navbar.Brand>
        <Navbar.Content hideIn="xs">
          <Navbar.Link isActive href="#">Home</Navbar.Link>
          <Navbar.Link href="#" onClick={handler}>Purchase</Navbar.Link>
        </Navbar.Content>
        <Navbar.Content>

        </Navbar.Content>
      </Navbar>
    <div style = {{marginLeft: "275px"}}>
    <>
      <div style = {{marginTop: "220px", fontFamily: "Inter", fontWeight: "bold", fontSize: "56px"}}>Greatest Streamable</div>
      <div className="wrapperz">
